const ToDoItems = (props) => {
    return (
        <div key={props.id} className='listItem'>
            <button className='deleteBtn' onClick={() => props.onSelect(props.id)}> &#10540; </button>
            <li className='list'>{props.currentItem} </li>
        </div>
    )
}

export default ToDoItems;
